import "mocha";
import { MailerClient } from "../index";
import { SendRequest } from "../defs/mailer";

const base64JpgFile = {
  fileName: "sun.jpg",
  content:
    "",
};

const base64PdfFile = {
  fileName: "sample.pdf",
  content:
    "",
};

const mailerClient = new MailerClient({
  host: "localhost",
  port: 50060,
});

describe("Resource Mailer", () => {
  it("Should send mail", async () => {
    const request: SendRequest = {
      emails: [
        {
          sender: {
            name: "tsh.io",
            email: "sender@example.com",
          },
          recipient: {
            to: ["recipient@example.com"],
          },
          template: {
            id: "test",
            parameters: {
              firstName: "Antonio",
              lastName: "Hernández",
            },
          },
          attachments: [base64JpgFile, base64PdfFile],
        },
      ],
    };

    await mailerClient.mailer.send(request);
  });
});
